    id: string,
    data: {
      serviceName?: string
      projectName?: string
      monitoringDomains?: string[] // Expect domains to be handled separately
      defaultSearchArea?: SearchArea
    }
  ): Promise<ServiceWithDomains> {
    // Renamed return type
    const service = await this.findOne<OwnedService>(id)
    if (!service || service.spaceId !== spaceId) {
