  }

  // Method to set/replace service domains (Renamed from setServiceUrls)
  async setMonitoringDomains(
    serviceId: string,
    domains: string[],
    tx?: Prisma.TransactionClient
  ): Promise<void> {
    // Domain validation that allows paths (e.g., note.com/path)
    // Updated to support multiple subdomains like employment.en-japan.com
    const domainRegex =
      /^[a-zA-Z0-9](?:[a-zA-Z0-9-]{0,61}[a-zA-Z0-9])?(?:\.[a-zA-Z0-9](?:[a-zA-Z0-9-]{0,61}[a-zA-Z0-9])?)*(?:\.[a-zA-Z]{2,})+(?:\/[^\s]*)?$/
    const validatedDomains = domains.map(domain => {
      const trimmedDomain = domain.trim()
      if (!domainRegex.test(trimmedDomain)) {
        throw createError.validation(`Invalid domain format: ${domain}`)
      }
      return trimmedDomain
    })

    const transactionFn = async (prismaTx: Prisma.TransactionClient) => {
      logger.debug(`Deleting existing domains for service ${serviceId}`)
      await prismaTx.monitoringDomain.deleteMany({ where: { serviceId } }) // Use new model name

      logger.debug(`Creating ${validatedDomains.length} new domains for service ${serviceId}`)
      await prismaTx.monitoringDomain.createMany({
        // Use new model name
        data: validatedDomains.map((domain, index) => ({
          serviceId,
          domain, // Use domain field
          isPrimary: index === 0,
        })),
      })
    }

    if (tx) {
      await transactionFn(tx)
    } else {
      await this.prisma.$transaction(transactionFn, config.database.transaction)
    }
    logger.info(`Successfully set ${validatedDomains.length} domains for service ${serviceId}`)
  }

